COVID-19 Daily Report - July 24, 2020

post_text:
Rockdale County we need your feedback on the future of economic development in the community. The Conyers-Rockdale Economic Development Strategy steering committee will use the input to develop the community’s economic development strategic plan. There are three ways residents can give their input: two live virtual events and the online feedback form. Residents will only need to participate in one of the three options.
To fill out the online feedback form and to preregister for both virtual events, residents can visit the link below: https://bit.ly/CRCEDS2020
@VinsonInstitute

